import React, {Component} from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';

import './css/FrontPage.css';

class FrontPage extends Component {
  render(){
    return(
      <div>
        <div className="lineargradientrainbow135 fpcontainer">
          <h1 className="align-item-center">
            Club Name
          </h1>
        </div>

        <div className="fpcontainer">
          <Container fluid className="align-item-center">
            <Row>
              <Col className="regcontainer" xs={12} s={6}>
                <Image style={{height:"46vh", maxWidth:"100%"}} className="align-item-center" src="imgs/people_stock_img.jpeg" />
              </Col>
              <Col className="regcontainer" xs={12} s={6}>
                <h3 className="align-item-center"> some random information </h3>
              </Col>
            </Row>
            <Row>
              <Col className="regcontainer" xs={12} m={6}>
                <h3 className="align-item-center"> some random information </h3>
              </Col>
              <Col className="regcontainer" xs={12} m={6}>
               <Image style={{height:"46vh", maxWidth:"100%"}} className="align-item-center" src="imgs/people_stock_img.jpeg" />
              </Col>
            </Row>
          </Container>
        </div>

        <div className="lineargradientrainbow45 fpcontainer">

        </div>
      </div>
    );
  }
}

export default FrontPage;
